INSERT INTO `products` VALUES (1,'Web Design for Developers','<p>\n       <em>Web Design for Developers</em> will show you how to make your\n       web-based application look professionally designed. We\'ll help you\n       learn how to pick the right colors and fonts, avoid costly interface\n       and accessibility mistakes -- your application will really come alive.\n       We\'ll also walk you through some common Photoshop and CSS techniques\n       and work through a web site redesign, taking a new design from concept\n       all the way to implementation.\n      </p>','/images/wd4d.jpg','42.95','2010-11-24 09:21:12','2010-11-24 09:21:12',NULL,NULL,NULL,NULL,0,1),(2,'Programming Ruby 1.9','<p>\r\n        Ruby is the fastest growing and most exciting dynamic language out\r\n        there. If you need to get working programs delivered fast, you should\r\n        add Ruby to your toolbox.\r\n      </p>','/images/ruby.jpg','49.50','2010-11-24 09:21:12','2010-11-24 10:13:13','ruby3.jpg','image/jpeg',31017,'2010-11-24 10:13:12',0,2),(3,'Debug It! ABDDDDDDDD','<p>        Professional programmers develop a knack of unerringly zeroing in on        the root cause of a bug. They can do that because they\'ve written a        lot of buggy code and then gained experience fixing it. This book        captures all this experience -- use it, and you\'ll find you write fewer        bugs, and the ones you do write will become easier to hunt down.<img src=\"/system/qor_media_library/product/1/normal.jpg?1290591453888\" class=\"align_left\" crop_w=\"153\" crop_h=\"50\" crop_x=\"24\" crop_y=\"47\">      </p>','/images/debug.jpg','34.95','2010-11-24 09:21:12','2010-11-24 09:57:52','rails4.jpg','image/jpeg',12571,'2010-11-24 09:57:52',0,3),(4,'Ruby 1.9.0','Desc 0','/missing.png','100.00','2010-11-24 10:09:16','2010-11-24 10:09:16',NULL,NULL,NULL,NULL,0,4),(5,'Ruby 1.9.1','Desc 1','/missing.png','200.00','2010-11-24 10:09:16','2010-11-24 10:09:16',NULL,NULL,NULL,NULL,0,5),(6,'Ruby 1.9.2